const initialState = {
    mainPost:[{
        id:1,
        User:{
            id:1,
            nickname:'pk',
        },
        content: 'this is first #hastage',
        Images:[{
            src: 'data:image/jpeg;base64,',
        }],
        Comments: [{
            user:{
                nickname: 'pk',
            },
            content: 'thisis new',
        },{
            user:{
                nickname: 'hero',
            },
            content: 'thisis new!@#!@$',
        }]
    }],
}

const reducer = (state = initialState, action) => {
    switch (action.type){
        default:
            return state;
    }
};

export default reducer;
